import React from 'react';

class SeasonDisplay extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div>
                Latitude: {this.props.latitude}
                <br />
                Longitude: {this.props.longitude}
            </div>
        );
    }
}

export default SeasonDisplay;
